var UIBlockUI = function () {
    var o = function () {
        $("#video-uploader").change(function () {
            if($('#title').val() != ''){
                App.blockUI({
                    target: "#video-upload-portlet",
                    boxed: !0
                })
            }
        })
        }
    return {
        init: function () {
            o()
        }
    }
}();
jQuery(document).ready(function () {
    UIBlockUI.init();
});